import React from 'react'

const NewPage = () => {
  return (
    <div>
      {/* <script type="text/javascript">
        window.onload = montre;
        function montre(id) {
          var d = document.getElementById(id);
    
          for (var i = 1; i <= 10; i++) {
    
            if (document.getElementById('smenu' + i)) { document.getElementById('smenu' + i).style.display = "none"; }
    
          }
          if (d) { d.style.display = "block"; }
        }
    
      </script> */}
    
      <style type="text/css">
        body {
          {background: "white",
    
          padding: "0",
          margin: "0",
          fontSize:" 90%",
          color: "black"}
    
        }
    
        dl,
        dt,
        dd,
        ul,
        li {
          {margin: "0",
    
          padding: "0",
          listStyleType: "none"}
        }
    
        #menu {
    
          {position: "absolute",
          top: "lem",
    
          left: "lem",
    
          width: "10em"}
    
        }
    
        #menu dt {
          {cursor: "pointer",
    
          background: "#A9BFCB",
          height: "20px",
          lineHeight: "20px",
          margin: "2px 0",
          border: "1px solid gray",
          textAlign: "center",
          fontWeight: "bold",}
    
        }
    
        #menu dd {
         { position: "absolute",
          zIndex: "100",
    
          left: "8em",
          marginTop: "-1.4em",
          width: "10em",
    
          background: "#A9BFCB",
    
          border: "1px solid gray"
    
        }}
    
        #menu ul {
          {padding: "2px"}
        }
    
        #menu li {
    
          {textAlign: "center",
          fontSize:" 85%",
          height: "18px",
          lineHeight: "18px"}
        }
    
        #menu li a,
        #menu dt a {
    
          {color: "#000",
    
          textDecoration: "none",
          display: "block"}
    
        }
    
        #menu li azhover {
         { textDecoration: "underline"}
    
        }
    
        #mentions {
          {
          position: "absolute",
    
          bottom: "200px",
          left: "10px",
          color: "#000",
    
          backgroundColor: "#ddd"}
        }
    
        #fmentions a {
         { textDecoration: "none",
    
          color: "#222"}
    
        }
    
        #mentions a:hover {
          {textDecoration: "underline"}
    
        }
      </style>
    
   
    <dl id="menu">
    
    <dt onMouseOver="javascript:montre('smenu1');"><a href="">Menu 1</a></dt>

    <dd id="smenu1" ghmouseover="javascript:montre('smenu1');" onMouseOut="javascript:montre();">

      <ul>
        <li><a href="">Menu 1.1</a></li>
        <li><a href="">Menu 1.2</a></li>
        <li><a href="">Menu 1.3</a></li>
      </ul>
    </dd>

    <dt onMouseOver="javascript:montre('smenu2');" onMouseOut="javascript:montre();">Menu 2</dt>

    <dd id="smenu2" onMouseOver="javascript:montre('smenu2');" onMouseOut="javascript:montre();">
      <ul>
        <li><a href="">Menu 2.1</a></li>
        <li><a href="">Menu 2.2</a></li>
      </ul>
    </dd>

    <dt onMouseOver="javascript:montre('smenu3');" onMouseOut="javascript:montre();">Menu 3</dt>

    <dd id="smenu3" onMouseOver="javascript:montre('smenu3');" onMouseOut="javascript:montre();">
      <ul>
        <li><a href="">Menu 3.1</a></li>
        <li><a href="">Menu 3.1</a></li>
        <li><a href="">Menu 3.1</a></li>
        <li><a href="">Menu 3.1</a></li>
        <li><a href="">Menu 3.1</a></li>
        <li><a href="">Menu 3.1</a></li>
      </ul>
    </dd>

    <dt onMouseOver="javascript:montre('smenu4');" onMouseOut="javascript:montre();">Menu 4</dt>
    <dd id="smenu4" onMouseOver="javascript:montre('smenu4');" onMouseOut="javascript:montre();">
      <ul>
        <li><a href="">Menu 4.1</a></li>
        <li><a href="">Menu 4.1</a></li>
      </ul>
    </dd>
  </dl>
</div>
  )
}

export default NewPage
